define({"topics" : [{"title":"Timeline","shortdesc":"<p class=\"shortdesc\">Plot-It allows users to view information in relation with its geographical and temporal     location. Users can manipulate the timeline for a better view of the data points. </p>","href":"DITA_Files-Various_Applications\/Plot-It\/Timeline.html","attributes": {"data-id":"reference_jhm_bxr_5r",},"menu": {"hasChildren":false,},"tocID":"reference_jhm_bxr_5r-d62e1398","topics":[]},{"title":"Panel","shortdesc":"<p class=\"shortdesc\">Users have the opportunity to view events in either the map, as a list, or in a grid.  </p>","href":"DITA_Files-Various_Applications\/Plot-It\/Panel.html","attributes": {"data-id":"reference_bd1_5ls_5r",},"menu": {"hasChildren":false,},"tocID":"reference_bd1_5ls_5r-d62e1409","topics":[]},{"title":"Events","shortdesc":"<p class=\"shortdesc\">Events are located in both the timeline and the panel below. The event metadata     provides more information about the event.</p>","href":"DITA_Files-Various_Applications\/Plot-It\/Events.html","attributes": {"data-id":"reference_rvb_sct_5r",},"menu": {"hasChildren":false,},"tocID":"reference_rvb_sct_5r-d62e1420","topics":[]},{"title":"Search","shortdesc":"<p class=\"shortdesc\">Users can search to narrow down or find a specific data point. The search function is     accessed on the left side of Plot-It.</p>","href":"DITA_Files-Various_Applications\/Plot-It\/SearchReference.html","attributes": {"data-id":"reference_mng_jss_5r",},"menu": {"hasChildren":false,},"tocID":"reference_mng_jss_5r-d62e1431","topics":[]}]});